INSERT INTO `blog_posts` VALUES (2,'Renseignements sur l\'hypothèque','Obtenez une copie de votre dossier de crédit auprès d’Equifax.com (ou d’un service équivalent). Passez en revue chaque ligne du dossier et si vous relevez des erreurs ou des omissions, communiquez avec votre bureau de crédit pour les faire corriger. Comment se porte votre cote? Acquitter votre dette de carte de crédit est une façon d’améliorer votre cote.','<section class=\"textOnly section-container\" style=\"margin: 0px auto; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: 1120px;\"><h4 style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; padding: 0px 0px 0.5em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Vérifiez votre cote de crédit</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Obtenez une copie de votre dossier de crédit auprès d’Equifax.com (ou d’un service équivalent). Passez en revue chaque ligne du dossier et si vous relevez des erreurs ou des omissions, communiquez avec votre bureau de crédit pour les faire corriger. Comment se porte votre cote? Acquitter votre dette de carte de crédit est une façon d’améliorer votre cote.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\"><span style=\"color: rgb(224, 0, 52); font-family: &quot;Fjalla One&quot;, sans-serif; font-size: 1.5rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; text-transform: uppercase;\"><br></span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\"><span style=\"color: rgb(224, 0, 52); font-family: &quot;Fjalla One&quot;, sans-serif; font-size: 1.5rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; text-transform: uppercase;\">TROUVER FACILEMENT UN PRÊT HYPOTHÉCAIRE</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\"><span style=\"color: rgb(224, 0, 52); font-family: &quot;Fjalla One&quot;, sans-serif; font-size: 1.5rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; text-transform: uppercase;\"><br></span><span style=\"font-size: 0.8rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-family: inherit; font-weight: inherit;\">Si vous êtes comme tout le monde, vous estimez que de magasiner un prêt hypothécaire est à peu près aussi amusant que de subir un traitement de canal. Mais ce n’est vraiment pas nécessaire qu’il en soit ainsi. Voici une série d’étapes à respecter afin que vous soyez certain de trouver un prêt hypothécaire qui vous convient.</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\"><span style=\"font-size: 0.8rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-family: inherit; font-weight: inherit;\"><br></span><span style=\"color: rgb(224, 0, 52); font-family: &quot;Fjalla One&quot;, sans-serif; font-size: 1.5rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\">Faites vos calculs</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\"><span style=\"color: rgb(224, 0, 52); font-family: &quot;Fjalla One&quot;, sans-serif; font-size: 1.5rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit;\"><br></span><span style=\"font-size: 0.8rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; font-family: inherit;\">Maintenant que vous avez une idée de combien vous devez, pensez à tous les actifs que vous possédez (votre propriété actuelle, vos placements, vos actions, vos obligations et vos autres propriétés) et faites-en la somme. Conseil utile : il est préférable de posséder plus que ce que vous devez. Vous pouvez facilement trouver en ligne des calculatrices qui vous aideront à y voir clair dans tous ces chiffres et à déterminer approximativement le montant du prêt hypothécaire que vous pouvez obtenir.</span></p></section><article class=\"article section-container\" style=\"margin: 5.5em auto 0px; padding: 0px 0px 78.3906px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; display: table; width: 784px; max-width: 1120px;\"><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Obtenir une estimation approximative</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Allez rencontrer un représentant d’une institution financière ou d’un prêteur. Les questions qu’il ou elle vous posera feront peut-être ressortir certains oublis commis lors de votre évaluation initiale, par exemple des éléments de passif ou d’actif que vous n’aviez même pas réalisé que vous possédiez. En s’appuyant sur cette information, ils vous donneront une estimation approximative du montant que vous pouvez emprunter. Sachez toutefois que ce processus informel ne constitue pas une garantie ni une préautorisation. Il vise simplement à vous donner une idée de quelles propriétés vous pouvez vous permettre et à vous aider à déterminer si vous êtes prêts à prendre cet engagement financier.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Apprenez le jargon</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Faites vos devoirs, familiarisez-vous avec les termes et les options hypothécaires. Discutez avec votre agent, abordez le sujet avec vos amis et avec les membres de votre famille et allez visiter les nombreux sites web qui traitent de périodes d’amortissement, des avantages et inconvénients des taux fixes et des taux variables, etc. – vous en apprendrez beaucoup.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Choisissez un prêteur</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Puisque contracter une hypothèque constitue l’un des contrats financiers les plus importants que vous puissiez conclure, il peut être payant de bien magasiner d’abord. Même si vous entretenez d’excellentes relations avec votre institution financière, cela ne peut vous nuire d’explorer les possibilités que peuvent vous offrir d’autres établissements de crédit en matière de prêt hypothécaire.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Nombreux sont les acheteurs qui ont trouvé du financement en ligne, grâce à un moteur de recherche de prêts hypothécaires ou en visitant le site d’une entreprise « clic et mortier ». Vous n’avez pas besoin de sortir de chez vous, et vous pouvez magasiner 24 heures sur 24, 7 jours par semaine. Sachez cependant que la recherche en ligne peut vous faire passer à côté d’une possibilité intéressante dont vous auriez peut-être appris l’existence si vous aviez parlé à un spécialiste en personne.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Si vous êtes pris par le temps, un courtier hypothécaire peut « magasiner » pour vous et trouver le meilleur taux possible. Avant de choisir un courtier, assurez-vous qu’il ou elle n’est pas affilié(e) à une institution financière ou à une institution prêteuse particulière.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Obtenez une préautorisation</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Obtenir une préautorisation hypothécaire marque un pas de plus par rapport à l’estimation approximative (abordée précédemment). Il s’agit ni plus ni moins d’une autorisation de la part d’un prêteur relativement au prêt d’un montant déterminé, à un taux d’intérêt déterminé, le tout demeurant valide pour une certaine période (habituellement 90 à 120 jours).</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: inherit; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Voilà — vous connaissez maintenant les étapes simples grâce auxquelles vous pourrez contracter une hypothèque, qui non seulement sera adaptée à vos besoins, mais qui, surtout, vous permettra d’emménager dans la maison de vos rêves.</p></section></article>',1,'post','published','157249138620101203113629170_23816.jpg',1,'2019-10-31 07:09:46','2019-10-31 07:14:18','x',NULL,NULL),(3,'Trucs de déménagement','Mais emballer, dire au revoir aux amis et s’adapter à un nouveau lieu est particulièrement difficile pour des enfants. Alors, que vous déménagiez avec des tout-petits ou des adolescents, voici quelques idées pour en faire une expérience sans stress (bon d’accord, avec moins de stress) pour tous, adultes comme enfants.','<div class=\"articleIntro\" style=\"margin: 0px 0px 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline;\"><div class=\"bodyPhotoFullLeftCopy\" style=\"margin: 0px; padding: 0px 0px 0px 2.5rem; border: 0px; font: inherit; vertical-align: baseline; float: right; width: 509.594px; position: relative;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0.5em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52); text-transform: uppercase;\"><br></h4><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0.5em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52); text-transform: uppercase;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20101203113224660_23816 (1).jpg\" style=\"font-size: 1.5rem; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; width: 400px;\"><br></h4></div></div><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Déménager cause du stress.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Mais emballer, dire au revoir aux amis et s’adapter à un nouveau lieu est particulièrement difficile pour des enfants. Alors, que vous déménagiez avec des tout-petits ou des adolescents, voici quelques idées pour en faire une expérience sans stress (bon d’accord, avec moins de stress) pour tous, adultes comme enfants.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Parlez-leur.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">N’annoncez pas simplement le déménagement de but en blanc à vos enfants. Parlez-en aussitôt que possible pour qu’ils aient amplement de temps pour y penser. Expliquez-leur où vous déménagez et pourquoi. Soulignez les avantages de la nouvelle demeure (la maison est plus grande, plus proche de l’école, dans une ville fascinante, etc.) et les avantages que cela représente pour eux en particulier.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Parlez-leur.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">N’annoncez pas simplement le déménagement de but en blanc à vos enfants. Parlez-en aussitôt que possible pour qu’ils aient amplement de temps pour y penser. Expliquez-leur où vous déménagez et pourquoi. Soulignez les avantages de la nouvelle demeure (la maison est plus grande, plus proche de l’école, dans une ville fascinante, etc.) et les avantages que cela représente pour eux en particulier.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Écoutez.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Encouragez-les à poser des questions et à exprimer leurs anxiétés et leurs craintes. Demandez-leur de faire une liste de questions et de les présenter lors d’une réunion de famille.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Rassurez-les.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Dites à vos enfants que même s’ils changent de maison, leur vie restera pratiquement la même, qu’ils auront toujours une cour pour jouer par exemple, qu’ils continueront d’aller à l’école, à vivre avec leurs frères et sœurs, leurs parents et leurs animaux domestiques et à dormir dans le même lit.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Impliquez-les.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Donnez du pouvoir à vos enfants en les laissant prendre le plus de décisions possible. Encouragez-les à planifier leur nouvelle chambre en les laissant choisir la couleur de la peinture ou en choisissant comment disposer les meubles. Ils peuvent participer à l’emballage et à d’autres tâches, explorer le nouveau voisinage et prendre soin des animaux le jour du déménagement. Et si vous le voulez, les enfants peuvent même participer à la recherche de la nouvelle maison et avoir leur mot à dire dans son choix.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Faites-en une aventure.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Restez positif, votre attitude influencera la leur. Parlez de toutes les choses intéressantes qu’ils pourront faire, des programmes auxquels ils pourront participer. Dites-leur s’il y a un comptoir de crème-glacée au coin de la rue ou un superbe terrain de jeux tout près. Organisez une chasse au trésor pour apprendre à connaître le voisinage (encore mieux, invitez des enfants du voisinage à participer).</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Faites vos devoirs.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Faire face à l’inconnu rend les enfants anxieux. Montrez-leur à quoi s’attendre en allant chercher beaucoup de renseignements sur le nouveau voisinage, la nouvelle école, les possibilités d’emploi à temps partiel pour les enfants plus grands, les activités sociales et les sports. Montrez-leur des cartes et des photos et explorez le quartier ensemble, avant de déménager.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Pensez au bon moment.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Idéalement, le mieux est de déménager pendant l’été pour que les enfants n’aient pas à aller dans une nouvelle école en milieu d’année scolaire. Mais si un déménagement en milieu d’année est inévitable, parlez aux professeurs de vos enfants pour trouver des façons de rendre la transition aussi facile que possible. D’une façon ou d’une autre, faites le tour de l’école avec eux avant que les cours ne commencent pour qu’ils sachent à quoi s’attendre.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Emballez une boîte de survie pour enfants.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Remplissez-la de choses dont ils ont besoin pour se sentir chez eux la première nuit et le premier matin dans le nouvel endroit. Ajoutez-y leurs collations, leurs jouets, leurs livres et leurs photos préférés, ainsi que des vêtements de rechange, des pantoufles, un appareil photo, un lecteur MP3, des pyjamas, une brosse à dents, etc.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Dites au revoir.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">&nbsp;Faites une fête « d’adieu » pour dire au revoir aux amis et célébrer votre nouvelle aventure. Visitez les endroits préférés une dernière fois. Puis, lorsque votre maison est vide, faites le tour de chacune des pièces et parlez de tous les souvenirs que vous en gardez.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Amenez des souvenirs.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Prenez des photos ou une vidéo de votre maison et des gens et endroits préférés de vos enfants. Faites un album personnalisé avec les photos des amis et des voisins et faites leur écrire leur adresse et autres messages à côté de leur photo afin que vos enfants puissent garder le contact.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Trouvez un gardien pour le jour du déménagement.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Laissez les plus jeunes enfants avec leurs grands-parents ou un voisin pendant l’inévitable chaos du chargement du camion de déménagement. Vous n’aurez pas à les surveiller et ils ne seront pas perturbés par l’agitation.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">N’essayez pas de tout déballer en un jour.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">&nbsp;Déchargez les choses essentielles, installez les lits de chacun, puis prenez une pause. Déballer est ennuyant - assurez-vous d’entrecouper le déballage avec des choses plaisantes comme de faire une promenade, aller manger au restaurant ou aller faire un tour au parc. Avec de petits enfants, l’un des parents peut amener les enfants faire un tour pendant que l’autre déballe, puis inversez les rôles.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Respectez votre horaire habituel.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Les enfants s’épanouissent dans la routine. Gardez les repas et les siestes aux heures habituelles et ne modifiez pas les routines du lever et du coucher. Vous leur enverrez ainsi le message que vous êtes toujours une famille et que les choses n’ont pas vraiment changé même si vous êtes dans un nouvel endroit.</p></section><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"><h4 style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; color: rgb(224, 0, 52);\">Faites-vous des amis.</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; vertical-align: baseline; color: rgb(45, 45, 45); word-break: break-word;\">Présentez-vous à des familles avec des enfants du voisinage. Inscrivez les enfants à des camps locaux et à des programmes parascolaires. Allez au parc local.</p></section><p><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; position: relative; width: 784px; max-width: none;\"></section></p><section class=\"textOnly section-container\" style=\"margin: 0px auto 2em; padding: 0px; border: 0px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 300; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; box-sizing: border-box; display: block; position: relative; width: 784px; max-width: none; color: rgb(0, 0, 0); letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\"><h4 style=\"margin: 0px; padding: 0px; border: none; font-style: inherit; font-variant: inherit; font-weight: 400; font-stretch: inherit; font-size: 1.5rem; line-height: inherit; font-family: &quot;Fjalla One&quot;, sans-serif; vertical-align: baseline; box-sizing: border-box; color: rgb(224, 0, 52);\">Soyez patient.</h4><p style=\"margin: 0px; padding: 0.5em 0px 0.7em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 300; font-stretch: inherit; font-size: 0.8rem; line-height: 1.6; font-family: &quot;Open Sans&quot;, sans-serif; vertical-align: baseline; box-sizing: border-box; color: rgb(45, 45, 45); word-break: break-word;\">Vos enfants ont perdu ce qui leur était familier et il faut parfois du temps avant qu’ils n’acceptent leur nouvelle maison. Soutenez-les, prenez le temps de parler avec eux et vous verrez, ils y arriveront.</p></section>',1,'post','published','157249148420101203113224660_23816_(1).jpg',1,'2019-10-31 07:11:24','2019-11-03 19:50:04','x33',NULL,NULL),(4,'1','1','<p>1</p>',1,'post','published','1572792624architecture-1868667_1920.jpg',1,'2019-11-03 19:50:24','2019-11-03 19:50:24','2','2','<p>2</p>');
